import React from 'react'


import Styled from 'styled-components'

import {AiOutlineLogout} from 'react-icons/ai'
import {GrHomeRounded} from 'react-icons/ai'
const Sidebar=()=> { 
  return (
    <SidebarContainer>
        <Menu>
            <a >
                <DashboardIcon/>
                <span>Dashboard</span>
            </a>
            <a>

                Clients
            </a>
            <a>
                Bodyguard
            </a>
            <a>
                Team
            </a>
            <a>
                Settings
            </a>
            <a>
                Another
            </a>
            
        </Menu>
        <Logout>
          <LogoutIcon/>
          <span>Logout</span>
        </Logout>

    </SidebarContainer>
  )
}

export default Sidebar;

const SidebarContainer = Styled.div`
    display:flex;
    flex-direction: column;
    justify-content: space-between;
    
    background:white;
    width:250px;
    top: 100px;
    left:0;
    bottom:0;
    box-shadow: 0 0 10px rgba(0,0,0,.5);
    



`
const Menu = Styled.div`
display:flex;
justify-content:space-between;
align-items:start;
flex-direction:column;
margin-bottom: 2rem;
padding: 5px;
left:0;
margin-left: 3rem;
a{
  padding:10px;
  display:flex;
  align-items:center;
  justify-content:center;
}


`
const Logout = Styled.div`

bottom:0px;
font-weight:400;
margin-bottom:0;
position:absolute;
margin-left:3rem;
display:flex;
align-items: center;




`

const LogoutIcon = Styled(AiOutlineLogout)`
padding-right: 3px;
font-weight:bold;
font-size:20px;
`

const DashboardIcon= Styled(GrHomeRounded)`

`
